import React from 'react';
import { Carousel } from "flowbite-react";
import contact_img from '../assets/contact_img.png';

const HomeCarousel = () => {
    return (
        <div className="h-56 sm:h-64 xl:h-80 2xl:h-96">
          <Carousel>
            <img src={contact_img} alt="..." />
            <img src={contact_img} alt="..." />
            <img src={contact_img} alt="..." />
            <img src={contact_img} alt="..." />
            <img src={contact_img} alt="..." />
          </Carousel>
        </div>
      );
};

export default HomeCarousel;
